webpackJsonp([41006479864164],{552:function(t,e){t.exports={data:{markdownRemark:{html:'<h3>Climate Cents 1.0.1</h3>\n<p>At last, a full releast of v1 of Climate Cents and a return to blogging after a year off.</p>\n<p>I blame the 2016 election. The fallout and emotion soaked up all my bandwidth.</p>\n<p>Anyways, here it is, Climate Cents.\n<a href="https://www.climatecents.org/">https://www.climatecents.org/</a></p>\n<p>And here is the repo.\n<a href="https://github.com/russellschmidt/climate-cents">https://github.com/russellschmidt/climate-cents</a></p>\n<h3>FutureStuff</h3>\n<p>The next version (1.1.0) out very soon will feature a challenges section that has teams competing to raise the most money for a specific challenge in a hat tip to Movember and kids running in circles around school yards for charity.</p>\n<p>I have also started using the Github projects section to guide contributors (me) for next steps. I would like to see 1.2.0 be more of a generic crowdfunding platform that anyone can use and brand as they see fit.</p>',frontmatter:{date:"October 13, 2017",path:"/blog/climate-cents-v101/",title:"Climate Cents v1.0.1",type:"blog"}}},pathContext:{}}}});
